import React, { useState } from 'react';
import profil from "../../assets/profil.png";
import mail from "../../assets/mail.png";
import pwd from "../../assets/pwd.png";
import code from "../../assets/code.png";

const Authentication = () => {
  const [action, setAction] = useState("Login");

  const styles = {
    container: {
      display: "flex",
      flexDirection: "column",
      margin: "auto",
      marginTop: "200px",
      width: "600px",
      background: "#fff",
      paddingBottom: "30px",
      borderRadius: "12px",
      boxShadow: "0px 4px 20px rgba(0, 0, 0, 0.2)",
      animation: "fadeIn 0.8s ease-out",
    },
    header: {
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      gap: "9px",
      width: "100%",
      marginTop: "30px",
    },
    text: {
      color: "#3c009d",
      fontSize: "48px",
      fontWeight: "700",
      animation: "pulse 1.5s infinite ease-in-out",
    },
    underline: {
      width: "61px",
      height: "6px",
      background: "#4c00b4",
      borderRadius: "9px",
      cursor: "pointer",
      transition: "background-color 0.3s ease",
    },
    inputs: {
      marginTop: "55px",
      display: "flex",
      flexDirection: "column",
      gap: "25px",
    },
    input: {
      display: "flex",
      alignItems: "center",
      margin: "auto",
      width: "480px",
      height: "80px",
      background: "#eaeaea",
      borderRadius: "6px",
      boxShadow: "0px 2px 10px rgba(0, 0, 0, 0.1)",
      transition: "transform 0.3s ease",
    },
    img: {
      margin: "0px 30px",
      width: "40px",
    },
    inputField: {
      height: "50px",
      width: "400px",
      background: "transparent",
      border: "none",
      outline: "none",
      color: "#797979",
      fontSize: "19px",
    },
    forgotPassword: {
      paddingLeft: "62px",
      marginTop: "27px",
      fontSize: "18px",
      color: "#797979",
    },
    submitContainer: {
      display: "flex",
      gap: "30px",
      margin: "60px auto",
    },
    submit: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      width: "220px",
      height: "59px",
      color: "#fff",
      background: "#4c00b4",
      borderRadius: "50px",
      fontSize: "19px",
      fontWeight: "700",
      cursor: "pointer",
      boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.2)",
      transition: "transform 0.3s ease, background-color 0.3s ease",
    },
    gray: {
      background: "#eaeaea",
      color: "#676767",
      cursor: "not-allowed",
    },
  };

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <div style={styles.text}>{action}</div>
        <div
          style={styles.underline}
          onClick={() => setAction(action === "Login" ? "Sign up" : "Login")}
        ></div>
      </div>

      <div style={styles.inputs}>
        {action === "Sign up" && (
          <div style={styles.input}>
            <img src={profil} alt="profile icon" style={styles.img} />
            <input
              type="text"
              placeholder="Username"
              style={styles.inputField}
            />
          </div>
        )}
        {action === "Login" && (
          <div style={styles.input}>
            <img src={code} alt="code icon" style={styles.img} />
            <input
              type="text"
              placeholder="Code"
              style={styles.inputField}
            />
          </div>
        )}

        <div style={styles.input}>
          <img src={mail} alt="email icon" style={styles.img} />
          <input
            type="text"
            placeholder="Email"
            style={styles.inputField}
          />
        </div>

        <div style={styles.input}>
          <img src={pwd} alt="password icon" style={styles.img} />
          <input
            type="password"
            placeholder="Password"
            style={styles.inputField}
          />
        </div>
        {action === "Sign up" && (
          <div style={styles.input}>
            <img src={pwd} alt="password icon" style={styles.img} />
            <input
              type="password"
              placeholder="Confirm Password"
              style={styles.inputField}
            />
          </div>
        )}
      </div>

      {action === "Login" && (
        <div style={styles.forgotPassword}>
          Forgot password<span> Click here!</span>
        </div>
      )}

      <div style={styles.submitContainer}>
        <div
          style={{
            ...styles.submit,
            ...(action === "Sign up" && styles.gray),
          }}
          onClick={() => setAction("Login")}
        >
          Login
        </div>
        <div
          style={{
            ...styles.submit,
            ...(action === "Login" && styles.gray),
          }}
          onClick={() => setAction("Sign up")}
        >
          Sign up
        </div>
      </div>
    </div>
  );
};

export default Authentication;
